import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Landing from './Landing';

function Router(){
    return(
        <BrowserRouter>
            <Switch>
                <Route path='/' component={Landing}></Route>
                <Route path='/forum' component={Landing}></Route>
            </Switch>
        </BrowserRouter>
    );
}

export default Router;
